import { Navbar } from "react-bootstrap";
import logo from "../LOGO.png";
import "./nav.css";
function Nav() {
	return (
		<header>
			<img src={logo} className='logo' alt='logo' />
			<nav className='nav_links'>
				<a href='#'>Home</a>
				<a href='#'>Work</a>
				<a href='#'>About</a>
				<a href='#'>Schedule</a>
				<a href='#'>Reviews</a>
				<a href='#'>Blog</a> <button className='lets'>Let's talk</button>
			</nav>

			<div id='menu-bar' className='fas fa-bars'></div>
		</header>
	);
}

export default Nav;
